var title_f43_6_44128="Phonocardiogram of bicuspid AS at apex";
var content_f43_6_44128=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1265px;\">",
"  <div class=\"videoplayer\" h264=\"./images/CARD/72877/as_bapex_conv.mp4?title=Phonocardiogram+of+bicuspid+AS+at+apex\" style=\"width:564px;height:378px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 581px\">",
"   <div class=\"ttl\">",
"    Carotid artery pulse tracing and phonocardiogram of aortic stenosis with bicuspid AS",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 561px; height: 221px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Carotid artery pulse tracing and phonocardiogram of aortic stenosis as heard at the apex. S1 (mitral and tricuspid valve closure) is followed by an ejection click from the opening of the stenotic aortic valve. A faint mid systolic murmur of aortic stenosis is heard. S2 is single as a result of delayed aortic valve closure which occurs simultaneously with closure of the pulmonic valve.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Provided by John M Criley, MD, The Physiological Origins of Heart Sounds and Murmurs, Little, Brown, Boston, 1996, 1-800-527-0145. This program contains a complete interactive tutorial integrating over 200 heart sounds and murmurs with cineangiographic, echo-Doppler, and hemodynamic motion picture sequences.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
