" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Cardiovascular side effects of neuromuscular blocking agents",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Drug",
"      </td>",
"      <td class=\"subtitle1\">",
"       Cardiovascular side effects",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Atracurium",
"      </td>",
"      <td>",
"       Moderate risk of hypotension secondary to histamine release and sympathetic ganglionic blockade",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Cisatracurium",
"      </td>",
"      <td>",
"       Minimal risk of histamine-associated hypotension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Doxacurium",
"      </td>",
"      <td>",
"       Minimal risk of histamine-associated hypotension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Metocurine",
"      </td>",
"      <td>",
"       Moderate risk of hypotension secondary to histamine release and sympathetic ganglionic blockade",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Mivacurium",
"      </td>",
"      <td>",
"       Minimal risk of histamine-associated hypotension with low doses (0.15 mg/kg); increased risk with larger doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pancuronium",
"      </td>",
"      <td>",
"       Moderate risk of tachycardia, hypertension, and increased cardiac output due to vagal blockade",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pipecuronium",
"      </td>",
"      <td>",
"       Minimal risk of histamine-associated hypotension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Rocuronium",
"      </td>",
"      <td>",
"       Minimal risk of histamine-associated hypotension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Succinylcholine",
"      </td>",
"      <td>",
"       Significant risk of elevated blood pressure, tachycardia, bradycardia, ventricular arrhythmias",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Tubocurarine",
"      </td>",
"      <td>",
"       Significant risk of histamine-associated hypotension, decreased systemic vascular resistance, and hypotension secondary to ganglionic blockade after prolonged use of high doses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Vecuronium",
"      </td>",
"      <td>",
"       Minimal risk of histamine-associated hypotension",
"      </td>",
"     </tr>",
"    </table>",
