var title_f43_6_44140="Poisoning syndromes - toxidromes";
var content_f43_6_44140=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F71268&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F71268&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Poisoning syndromes (toxidromes)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Toxidrome",
"       </td>",
"       <td class=\"subtitle1\">",
"        Mental status",
"       </td>",
"       <td class=\"subtitle1\">",
"        Pupils",
"       </td>",
"       <td class=\"subtitle1\">",
"        Vital signs",
"       </td>",
"       <td class=\"subtitle1\">",
"        Other manifestations",
"       </td>",
"       <td class=\"subtitle1\">",
"        Examples of toxic agents",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sympathomimetic",
"       </td>",
"       <td>",
"        Hyperalert, agitation, hallucinations, paranoia",
"       </td>",
"       <td>",
"        Mydriasis",
"       </td>",
"       <td>",
"        Hyperthermia, tachycardia, hypertension, widened pulse pressure, tachypnea, hyperpnea",
"       </td>",
"       <td>",
"        Diaphoresis, tremors, hyperreflexia, seizures",
"       </td>",
"       <td>",
"        Cocaine, amphetamines, cathinones, ephedrine, pseudoephedrine, phenylpropanolamine, theophylline, caffeine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anticholinergic",
"       </td>",
"       <td>",
"        Hypervigilance, agitation, hallucinations, delirium with mumbling speech, coma",
"       </td>",
"       <td>",
"        Mydriasis",
"       </td>",
"       <td>",
"        Hyperthermia, tachycardia, hypertension, tachypnea",
"       </td>",
"       <td>",
"        Dry flushed skin, dry mucous membranes, decreased bowel sounds, urinary retention, myoclonus, choreoathetosis, picking behavior, seizures (rare)",
"       </td>",
"       <td>",
"        Antihistamines, tricyclic antidepressants, cyclobenzaprine, orphenadrine, antiparkinson agents, antispasmodics, phenothiazines, atropine, scopolamine, belladonna alkaloids (eg, Jimson Weed)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hallucinogenic",
"       </td>",
"       <td>",
"        Hallucinations, perceptual distortions, depersonalization, synesthesia, agitation",
"       </td>",
"       <td>",
"        Mydriasis (usually)",
"       </td>",
"       <td>",
"        Hyperthermia, tachycardia, hypertension, tachypnea",
"       </td>",
"       <td>",
"        Nystagmus",
"       </td>",
"       <td>",
"        Phencyclidine, LSD, mescaline, psilocybin, designer amphetamines (eg, MDMA, MDEA)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Opioid",
"       </td>",
"       <td>",
"        CNS depression, coma",
"       </td>",
"       <td>",
"        Miosis",
"       </td>",
"       <td>",
"        Hypothermia, bradycardia, hypotension, apnea, bradypnea",
"       </td>",
"       <td>",
"        Hyporeflexia, pulmonary edema, needle marks",
"       </td>",
"       <td>",
"        Opiates (eg, heroin, morphine, methadone, oxycodone, hydromorphone), diphenoxylate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sedative-hypnotic",
"       </td>",
"       <td>",
"        CNS depression, confusion, stupor, coma",
"       </td>",
"       <td>",
"        Miosis (usually)",
"       </td>",
"       <td>",
"        Hypothermia, bradycardia, hypotension, apnea, bradypnea",
"       </td>",
"       <td>",
"        Hyporeflexia",
"       </td>",
"       <td>",
"        Benzodiazepines, barbiturates, carisoprodol, meprobamate, glutethimide, alcohols, zolpidem",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cholinergic",
"       </td>",
"       <td>",
"        Confusion, coma",
"       </td>",
"       <td>",
"        Miosis",
"       </td>",
"       <td>",
"        Bradycardia, hypertension orhypotension, tachypnea or bradypnea",
"       </td>",
"       <td>",
"        Salivation, urinary and fecal incontinence, diarrhea, emesis, diaphoresis, lacrimation, GI cramps, bronchoconstriction, muscle fasciculations and weakness, seizures",
"       </td>",
"       <td>",
"        Organophosphate and carbamate insecticides, nerve agents, nicotine, pilocarpine, physostigmine, edrophonium, bethanechol, urecholine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Serotonin syndrome",
"       </td>",
"       <td>",
"        Confusion, agitation, coma",
"       </td>",
"       <td>",
"        Mydriasis",
"       </td>",
"       <td>",
"        Hyperthermia, tachycardia, hypertension, tachypnea",
"       </td>",
"       <td>",
"        Tremor, myoclonus, hyperreflexia, clonus, diaphoresis, flushing, trismus, rigidity, diarrhea",
"       </td>",
"       <td>",
"        MAOIs alone or with: SSRIs, meperidine, dextromethorphan, TCAs, L-tryptophan",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CNS: central nervous system.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
